import React from 'react';

const Cell = (props) => {
  // iterate over the array and remove the student_id and _id and create a new array
  // map over the new array and return the table Cell

  let scores_only = [];

  Object.keys(props).forEach(key => {
    if ((key !== 'student_id') && (key !== '_id')) {
      scores_only.push(props[key]);
    }
  });

  return scores_only.map((score) => {
    return (
      <td className="cell scores">{score}%</td>
    )
  });
}

export default Cell;
